import axios from 'axios';
import { useState } from 'react';

function Home() {
    const [data, setData] = useState([]);
    const url = "http://127.0.0.1:8000/"
    axios.get(url).then(res => {
        setData(res.data);
        console.log(res.data);
    })

    return (
        <div>
            <h1>Home</h1>
            <p>{data}</p>
        </div>
    )
}

export default Home
